import React from "react";
import Link from "next/link";

const pages = () => {
  return (
    <div>
      <h1>its Main page</h1>
      <p>
        Go to
        <Link href="/auth">
          <a>Auth</a>
        </Link>
      </p>
    </div>
  );
};

export default pages;
